    mapping["x"] <- list(x)
  if (!missing(y)) 
    mapping["y"] <- list(y)
  caller_env <- parent.frame()
  as_quosure_aes <- function(x) {
    if (is.formula(x) && length(x) == 2) {
      as_quosure(x)
