list(`package:ggplot2` = function (geom, x = NULL, y = NULL, xmin = NULL, xmax = NULL, ymin = NULL, ymax = NULL, xend = NULL, yend = NULL, ..., na.rm = FALSE) 
{
  position <- compact(list(x = x, xmin = xmin, xmax = xmax, xend = xend, y = y, ymin = ymin, ymax = ymax, yend = yend))
  aesthetics <- c(position, list(...))
  lengths <- vapply(aesthetics, length, integer(1))
  n <- unique(lengths)
  if (length(n) > 1) {
    n <- setdiff(n, 1)
  }
  if (length(n) > 1) {
    bad <- lengths != 1
    details <- paste(names(aesthetics)[bad], " (", lengths[bad], ")", sep = "", collapse = ", ")
    abort(glue("Unequal parameter lengths: {details}"))
  }
  data <- new_data_frame(position, n = n)
  layer(geom = geom, params = list(na.rm = na.rm, ...), stat = StatIdentity, position = PositionIdentity, data = data, mapping = aes_all(names(data)), inherit.aes = FALSE, show.legend = FALSE)
}, function (geom, x = NULL, y = NULL, xmin = NULL, xmax = NULL, ymin = NULL, ymax = NULL, xend = NULL, yend = NULL, ..., na.rm = FALSE) 
{
  position <- compact(list(x = x, xmin = xmin, xmax = xmax, xend = xend, y = y, ymin = ymin, ymax = ymax, yend = yend))
  aesthetics <- c(position, list(...))
  lengths <- vapply(aesthetics, length, integer(1))
  n <- unique(lengths)
  if (length(n) > 1) {
    n <- setdiff(n, 1)
  }
  if (length(n) > 1) {
    bad <- lengths != 1
    details <- paste(names(aesthetics)[bad], " (", lengths[bad], ")", sep = "", collapse = ", ")
    abort(glue("Unequal parameter lengths: {details}"))
  }
  data <- new_data_frame(position, n = n)
  layer(geom = geom, params = list(na.rm = na.rm, ...), stat = StatIdentity, position = PositionIdentity, data = data, mapping = aes_all(names(data)), inherit.aes = FALSE, show.legend = FALSE)
})
