list(`package:ggplot2` = function (x, default = label_value, multi_line = TRUE) 
{
  force(x)
  fun <- function(labels) {
    labels <- lapply(labels, as.character)
    default <- dispatch_args(default, multi_line = multi_line)
    if (is_labeller(x)) {
      x <- dispatch_args(x, multi_line = multi_line)
      x(labels)
    }
    else if (is.function(x)) {
      default(lapply(labels, x))
    }
    else if (is.formula(x)) {
      default(lapply(labels, as_function(x)))
    }
    else if (is.character(x)) {
      default(lapply(labels, function(label) x[label]))
    }
    else {
      default(labels)
    }
  }
  structure(fun, class = "labeller")
}, function (x, default = label_value, multi_line = TRUE) 
{
  force(x)
  fun <- function(labels) {
    labels <- lapply(labels, as.character)
    default <- dispatch_args(default, multi_line = multi_line)
    if (is_labeller(x)) {
      x <- dispatch_args(x, multi_line = multi_line)
      x(labels)
    }
    else if (is.function(x)) {
      default(lapply(labels, x))
    }
    else if (is.formula(x)) {
      default(lapply(labels, as_function(x)))
    }
    else if (is.character(x)) {
      default(lapply(labels, function(label) x[label]))
    }
    else {
      default(labels)
    }
  }
  structure(fun, class = "labeller")
})
