list(`package:ggplot2` = function (x, width, center = NULL, boundary = NULL, closed = c("right", "left"), ...) 
{
  x <- as.numeric(x)
  width <- as.numeric(width)
  closed <- match.arg(closed)
  x_range <- range(x, na.rm = TRUE, finite = TRUE)
  if (length(x_range) == 0) {
    return(x)
  }
  if (!is.null(boundary) && !is.null(center)) {
    abort("Only one of 'boundary' and 'center' may be specified.")
  }
  if (is.null(boundary)) {
    if (is.null(center)) {
      boundary <- width/2
    }
    else {
      boundary <- center - width/2
    }
  }
  boundary <- as.numeric(boundary)
  min_x <- find_origin(x_range, width, boundary)
  max_x <- max(x, na.rm = TRUE) + (1 - 1e-08) * width
  breaks <- seq(min_x, max_x, width)
  cut(x, breaks, include.lowest = TRUE, right = (closed == "right"), ...)
}, function (x, width, center = NULL, boundary = NULL, closed = c("right", "left"), ...) 
{
  x <- as.numeric(x)
  width <- as.numeric(width)
  closed <- match.arg(closed)
  x_range <- range(x, na.rm = TRUE, finite = TRUE)
  if (length(x_range) == 0) {
    return(x)
  }
  if (!is.null(boundary) && !is.null(center)) {
    abort("Only one of 'boundary' and 'center' may be specified.")
  }
  if (is.null(boundary)) {
    if (is.null(center)) {
      boundary <- width/2
    }
    else {
      boundary <- center - width/2
    }
  }
  boundary <- as.numeric(boundary)
  min_x <- find_origin(x_range, width, boundary)
  max_x <- max(x, na.rm = TRUE) + (1 - 1e-08) * width
  breaks <- seq(min_x, max_x, width)
  cut(x, breaks, include.lowest = TRUE, right = (closed == "right"), ...)
})
