  facets_list <- grid_as_facets_list(rows, cols)
  labeller <- check_labeller(labeller)
  ggproto(NULL, FacetGrid, shrink = shrink, params = list(rows = facets_list$rows, cols = facets_list$cols, margins = margins, free = free, space_free = space_free, labeller = labeller, as.table = as.table, switch = switch, drop = drop))
