{
  scales <- match.arg(scales, c("fixed", "free_x", "free_y", "free"))
  dir <- match.arg(dir, c("h", "v"))
  free <- list(x = any(scales %in% c("free_x", "free")), y = any(scales %in% c("free_y", "free")))
  labeller <- check_labeller(labeller)
  facets <- wrap_as_facets_list(facets)
  if (!is.null(switch)) {
    .Deprecated("strip.position", old = "switch")
    strip.position <- if (switch == "x") 
      "bottom"
    else "left"
  }
  strip.position <- match.arg(strip.position, c("top", "bottom", "left", "right"))
  if (identical(dir, "v")) {
    nrow_swap <- ncol
    ncol_swap <- nrow
    nrow <- sanitise_dim(nrow_swap)
    ncol <- sanitise_dim(ncol_swap)
  }
  else {
    nrow <- sanitise_dim(nrow)
    ncol <- sanitise_dim(ncol)
  }
  ggproto(NULL, FacetWrap, shrink = shrink, params = list(facets = facets, free = free, as.table = as.table, strip.position = strip.position, drop = drop, ncol = ncol, nrow = nrow, labeller = labeller, dir = dir))
