list(`package:ggplot2` = function (mapping = NULL, data = NULL, ..., slope, intercept, na.rm = FALSE, show.legend = NA) 
{
  if (is.null(mapping) && missing(slope) && missing(intercept)) {
    slope <- 1
    intercept <- 0
  }
  if (!missing(slope) || !missing(intercept)) {
    if (!is.null(mapping)) {
      warn_overwritten_args("geom_abline()", "mapping", c("slope", "intercept"))
    }
    if (!is.null(data)) {
      warn_overwritten_args("geom_abline()", "data", c("slope", "intercept"))
    }
    if (missing(slope)) 
      slope <- 1
    if (missing(intercept)) 
      intercept <- 0
    n_slopes <- max(length(slope), length(intercept))
    data <- new_data_frame(list(intercept = intercept, slope = slope), n = n_slopes)
    mapping <- aes(intercept = intercept, slope = slope)
    show.legend <- FALSE
  }
  layer(data = data, mapping = mapping, stat = StatIdentity, geom = GeomAbline, position = PositionIdentity, show.legend = show.legend, inherit.aes = FALSE, params = list(na.rm = na.rm, ...))
}, function (mapping = NULL, data = NULL, ..., slope, intercept, na.rm = FALSE, show.legend = NA) 
{
  if (is.null(mapping) && missing(slope) && missing(intercept)) {
    slope <- 1
    intercept <- 0
  }
  if (!missing(slope) || !missing(intercept)) {
    if (!is.null(mapping)) {
      warn_overwritten_args("geom_abline()", "mapping", c("slope", "intercept"))
    }
    if (!is.null(data)) {
      warn_overwritten_args("geom_abline()", "data", c("slope", "intercept"))
    }
    if (missing(slope)) 
      slope <- 1
    if (missing(intercept)) 
      intercept <- 0
    n_slopes <- max(length(slope), length(intercept))
    data <- new_data_frame(list(intercept = intercept, slope = slope), n = n_slopes)
    mapping <- aes(intercept = intercept, slope = slope)
    show.legend <- FALSE
  }
  layer(data = data, mapping = mapping, stat = StatIdentity, geom = GeomAbline, position = PositionIdentity, show.legend = show.legend, inherit.aes = FALSE, params = list(na.rm = na.rm, ...))
})
