list(`package:ggplot2` = function (df, na.rm = FALSE, vars = names(df), name = "", finite = FALSE) 
{
  if (!is.logical(na.rm)) {
    abort("`na.rm` must be logical")
  }
  missing <- detect_missing(df, vars, finite)
  if (any(missing)) {
    df <- df[!missing, ]
    if (!na.rm) {
      if (name != "") 
        name <- paste(" (", name, ")", sep = "")
      str <- if (finite) 
        "non-finite"
      else "missing"
      warning_wrap("Removed ", sum(missing), " rows containing ", str, " values", name, ".")
    }
  }
  df
