list(`package:ggplot2` = function (data, target_crs, source_crs, authority_compliant = FALSE) 
{
  if (identical(target_crs, source_crs) || is.null(target_crs) || is.null(source_crs) || is.null(data) || is.na(target_crs) || is.na(source_crs) || !all(c("x", "y") %in% names(data))) {
    return(data)
  }
  sf_data <- cbind(data$x, data$y)
  out <- sf::sf_project(sf::st_crs(source_crs), sf::st_crs(target_crs), sf_data, keep = TRUE, warn = FALSE, authority_compliant = authority_compliant)
  out <- ifelse(is.finite(out), out, NA)
  data$x <- out[, 1]
  data$y <- out[, 2]
  data
}, function (data, target_crs, source_crs, authority_compliant = FALSE) 
{
  if (identical(target_crs, source_crs) || is.null(target_crs) || is.null(source_crs) || is.null(data) || is.na(target_crs) || is.na(source_crs) || !all(c("x", "y") %in% names(data))) {
    return(data)
  }
  sf_data <- cbind(data$x, data$y)
  out <- sf::sf_project(sf::st_crs(source_crs), sf::st_crs(target_crs), sf_data, keep = TRUE, warn = FALSE, authority_compliant = authority_compliant)
  out <- ifelse(is.finite(out), out, NA)
  data$x <- out[, 1]
  data$y <- out[, 2]
  data
})
