  switch(method, direct = {
    if (k == 0) return(as.bigz(1))
    if (k == n) return(as.bigz(0))
    if (k >= (n + 1)%/%2) k <- n - (k + 1)
    k1 <- k + 1
    sig <- rep(c(1, -1), length.out = k1)
