list(`package:gmp` = function (n, k) 
{
  stopifnot(length(n) == 1, length(k) == 1)
  if (k < 0 || n < k) 
    stop("'k' must be in 0..n !")
  if (n == 0) 
    return(as.bigz(1))
  if (k == 0) 
    return(as.bigz(0))
  S1 <- function(n, k) {
    if (k == 0 || n < k) 
      return(as.bigz(0))
    if (is.na(S <- St[[n]][k])) {
      St[[n]][[k]] <<- S <- if (n1 <- n - 1) 
        S1(n1, k - 1) - n1 * S1(n1, k)
      else as.bigz(1)
    }
    S
  }
  if (compute <- (nt <- length(St <- .Stirl..env$S1.tab)) < n) {
    length(St) <- n
    for (i in (nt + 1):n) St[[i]] <- rep.bigz(NA_bigz_, i)
  }
  else compute <- is.na(S <- St[[n]][k])
  if (compute) {
    S <- S1(n, k)
    .Stirl..env$S1.tab <- St
  }
  S
}, function (n, k) 
