list(`package:gmp` = function (n, k, method = c("lookup.or.store", "direct")) 
{
  stopifnot(length(n) == 1, length(k) == 1)
  if (k < 0 || n < k) 
    stop("'k' must be in 0..n !")
  method <- match.arg(method)
  switch(method, direct = {
    sig <- rep(c(1, -1) * (-1)^k, length.out = k + 1)
    k <- 0:k
    ga <- factorialZ(k)
    sum(sig * k^n/(ga * rev(ga)))
  }, lookup.or.store = {
    if (n == 0) return(as.bigz(1))
    if (k == 0) return(as.bigz(0))
    S2 <- function(n, k) {
      if (k == 0 || n < k) return(as.bigz(0))
      if (is.na(S <- St[[n]][k])) St[[n]][[k]] <<- S <- if (n1 <- n - 1) S2(n1, k - 1) + k * S2(n1, k) else as.bigz(1)
      S
    }
    if (compute <- (nt <- length(St <- .Stirl..env$S2.tab)) < n) {
      length(St) <- n
      for (i in (nt + 1):n) St[[i]] <- rep.bigz(NA_bigz_, i)
    } else compute <- is.na(S <- St[[n]][k])
    if (compute) {
      S <- S2(n, k)
      .Stirl..env$S2.tab <- St
    }
    S
  })
}, function (n, k, method = c("lookup.or.store", "direct")) 
{
  stopifnot(length(n) == 1, length(k) == 1)
  if (k < 0 || n < k) 
    stop("'k' must be in 0..n !")
  method <- match.arg(method)
  switch(method, direct = {
    sig <- rep(c(1, -1) * (-1)^k, length.out = k + 1)
    k <- 0:k
    ga <- factorialZ(k)
    sum(sig * k^n/(ga * rev(ga)))
  }, lookup.or.store = {
    if (n == 0) return(as.bigz(1))
    if (k == 0) return(as.bigz(0))
    S2 <- function(n, k) {
      if (k == 0 || n < k) return(as.bigz(0))
      if (is.na(S <- St[[n]][k])) St[[n]][[k]] <<- S <- if (n1 <- n - 1) S2(n1, k - 1) + k * S2(n1, k) else as.bigz(1)
      S
    }
    if (compute <- (nt <- length(St <- .Stirl..env$S2.tab)) < n) {
      length(St) <- n
      for (i in (nt + 1):n) St[[i]] <- rep.bigz(NA_bigz_, i)
    } else compute <- is.na(S <- St[[n]][k])
    if (compute) {
      S <- S2(n, k)
      .Stirl..env$S2.tab <- St
