    a <- reg
  }
  if (is.object(a) || is.list(a)) {
    p <- length(coefa <- as.vector(coef(a)))
    if (p > 2) 
      warning(gettextf("only using the first two of %d regression coefficients", p), domain = NA)
    islm <- inherits(a, "lm")
    noInt <- if (islm) 
      !as.logical(attr(stats::terms(a), "intercept"))
    else p == 1
    if (noInt) {
      a <- 0
      b <- coefa[1]
    }
    else {
      a <- coefa[1]
      b <- if (p >= 2) 
        coefa[2]
      else 0
    }
  }
  if (!is.null(coef)) {
    if (!is.null(a)) 
      warning("'a' and 'b' are overridden by 'coef'")
    a <- coef[1]
    b <- coef[2]
  }
