list(`package:graphics` = function (side, x, at, format, labels = TRUE, ...) 
{
  has.at <- !missing(at) && !is.null(at)
  x <- as.Date(if (has.at) 
    at
    else x)
  range <- sort(par("usr")[if (side%%2) 
    1:2
    else 3:4])
  range[1] <- ceiling(range[1])
  range[2] <- floor(range[2])
  d <- range[2] - range[1]
  z <- c(range, x[is.finite(x)])
  class(z) <- "Date"
  if (d < 7) 
    if (missing(format)) 
      format <- "%a"
  if (d < 100) {
    z <- .Date(pretty(z))
    if (missing(format)) 
      format <- "%b %d"
  }
  else if (d < 1.1 * 365) {
    zz <- as.POSIXlt(z)
    zz$mday <- 1
    zz$mon <- pretty(zz$mon)
    m <- length(zz$mon)
    m <- rep.int(zz$year[1], m)
    zz$year <- c(m, m + 1)
    z <- as.Date(zz)
    if (missing(format)) 
      format <- "%b"
  }
  else {
    zz <- as.POSIXlt(z)
    zz$mday <- 1
    zz$mon <- 0
    zz$year <- pretty(zz$year)
    z <- as.Date(zz)
    if (missing(format)) 
      format <- "%Y"
  }
  if (has.at) 
    z <- x[is.finite(x)]
  keep <- z >= range[1] & z <= range[2]
  z <- z[keep]
  z <- sort(unique(z))
  class(z) <- "Date"
  if (!is.logical(labels)) 
    labels <- labels[keep]
  else if (isTRUE(labels)) 
    labels <- format.Date(z, format = format)
  else if (isFALSE(labels)) 
    labels <- rep("", length(z))
  axis(side, at = z, labels = labels, ...)
