  is.x <- side%%2 == 1
  XY <- function(ch) paste0(if (is.x) 
    "x"
    else "y", ch)
  if (is.null(axp)) 
    axp <- par(XY("axp"))
  else if (!is.numeric(axp) || length(axp) != 3) 
    stop("invalid 'axp'")
  if (is.null(log)) 
    log <- par(XY("log"))
  else if (!is.logical(log) || anyNA(log)) 
    stop("invalid 'log'")
  if (log && axp[3] > 0) {
    if (!any((iC <- as.integer(axp[3])) == 1:3)) 
      stop("invalid positive 'axp[3]'")
    if (is.null(usr)) 
      usr <- par("usr")[if (is.x) 
        1:2
        else 3:4]
    else if (!is.numeric(usr) || length(usr) != 2) 
      stop("invalid 'usr'")
