      nintLog <- par("lab")[2 - is.x]
    if (is.finite(nintLog)) {
      axisTicks(usr, log = log, axp = axp, nint = nintLog)
    }
    else {
      if (needSort <- is.unsorted(usr)) {
        usr <- usr[2:1]
        axp <- axp[2:1]
      }
      else axp <- axp[1:2]
      ii <- round(log10(axp))
      x10 <- 10^((ii[1] - (iC >= 2)):ii[2])
