list(`package:graphics` = function (formula, data, given.values, panel = points, rows, columns, show.given = TRUE, col = par("fg"), pch = par("pch"), bar.bg = c(num = gray(0.8), fac = gray(0.95)), xlab = c(x.name, paste("Given :", a.name)), ylab = c(y.name, paste("Given :", b.name)), subscripts = FALSE, axlabels = function(f) abbreviate(levels(f)), number = 6, overlap = 0.5, xlim, ylim, ...) 
{
  deparen <- function(expr) {
    while (is.language(expr) && !is.name(expr) && deparse(expr[[1]])[1] == "(") expr <- expr[[2]]
    expr
  }
  bad.formula <- function() stop("invalid conditioning formula")
  bad.lengths <- function() stop("incompatible variable lengths")
  getOp <- function(call) deparse(call[[1]], backtick = FALSE)[[1]]
  formula <- deparen(formula)
  if (!inherits(formula, "formula")) 
    bad.formula()
  y <- deparen(formula[[2]])
  rhs <- deparen(formula[[3]])
  if (getOp(rhs) != "|") 
    bad.formula()
  x <- deparen(rhs[[2]])
  rhs <- deparen(rhs[[3]])
  if (is.language(rhs) && !is.name(rhs) && getOp(rhs) %in% c("*", "+")) {
    have.b <- TRUE
    a <- deparen(rhs[[2]])
    b <- deparen(rhs[[3]])
  }
  else {
    have.b <- FALSE
    a <- rhs
  }
  if (missing(data)) 
    data <- parent.frame()
  x.name <- deparse(x)
  x <- eval(x, data, parent.frame())
  nobs <- length(x)
  y.name <- deparse(y)
  y <- eval(y, data, parent.frame())
  if (length(y) != nobs) 
    bad.lengths()
  a.name <- deparse(a)
  a <- eval(a, data, parent.frame())
  if (length(a) != nobs) 
    bad.lengths()
  if (is.character(a)) 
    a <- as.factor(a)
  a.is.fac <- is.factor(a)
  if (have.b) {
    b.name <- deparse(b)
    b <- eval(b, data, parent.frame())
    if (length(b) != nobs) 
      bad.lengths()
    if (is.character(b)) 
      b <- as.factor(b)
    b.is.fac <- is.factor(b)
    missingrows <- which(is.na(x) | is.na(y) | is.na(a) | is.na(b))
  }
  else {
    missingrows <- which(is.na(x) | is.na(y) | is.na(a))
    b <- NULL
    b.name <- ""
  }
  number <- as.integer(number)
  if (length(number) == 0 || any(number < 1)) 
    stop("'number' must be integer >= 1")
  if (any(overlap >= 1)) 
    stop("'overlap' must be < 1 (and typically >= 0).")
  bad.givens <- function() stop("invalid 'given.values'")
  if (missing(given.values)) {
    a.intervals <- if (a.is.fac) {
      i <- seq_along(a.levels <- levels(a))
      a <- as.numeric(a)
      cbind(i - 0.5, i + 0.5)
    }
    else co.intervals(unclass(a), number = number[1], overlap = overlap[1])
    b.intervals <- if (have.b) {
      if (b.is.fac) {
        i <- seq_along(b.levels <- levels(b))
        b <- as.numeric(b)
        cbind(i - 0.5, i + 0.5)
      }
      else {
        if (length(number) == 1) 
          number <- rep.int(number, 2)
        if (length(overlap) == 1) 
          overlap <- rep.int(overlap, 2)
        co.intervals(unclass(b), number = number[2], overlap = overlap[2])
      }
    }
  }
  else {
    if (!is.list(given.values)) 
      given.values <- list(given.values)
    if (length(given.values) != (if (have.b) 
      2
      else 1)) 
      bad.givens()
    a.intervals <- given.values[[1]]
