list(`package:graphics` = function (x, color = c("#99CCFF", "#6699CC"), conf.level = 0.95, std = c("margins", "ind.max", "all.max"), margin = c(1, 2), space = 0.2, main = NULL, mfrow = NULL, mfcol = NULL) 
{
  if (!is.array(x)) 
    stop("'x' must be an array")
  if (length(dim(x)) == 2) {
    x <- if (is.null(dimnames(x))) 
      array(x, c(dim(x), 1))
    else array(x, c(dim(x), 1), c(dimnames(x), list(NULL)))
  }
  if (length(dim(x)) != 3) 
    stop("'x' must be 2- or 3-dimensional")
  if (any(dim(x)[1:2] != 2)) 
    stop("table for each stratum must be 2 by 2")
  dnx <- dimnames(x)
  if (is.null(dnx)) 
    dnx <- vector("list", 3)
  for (i in which(sapply(dnx, is.null))) dnx[[i]] <- LETTERS[seq_len(dim(x)[i])]
  if (is.null(names(dnx))) 
    i <- 1:3
  else i <- which(is.null(names(dnx)))
  if (any(i)) 
    names(dnx)[i] <- c("Row", "Col", "Strata")[i]
  dimnames(x) <- dnx
  k <- dim(x)[3]
  if (!((length(conf.level) == 1) && is.finite(conf.level) && (conf.level >= 0) && (conf.level < 1))) 
    stop("'conf.level' must be a single number between 0 and 1")
  if (conf.level == 0) 
    conf.level <- FALSE
  std <- match.arg(std)
  findTableWithOAM <- function(or, tab) {
    m <- rowSums(tab)[1]
    n <- rowSums(tab)[2]
    t <- colSums(tab)[1]
    if (or == 1) 
      x <- t * n/(m + n)
    else if (or == Inf) 
      x <- max(0, t - m)
    else {
      A <- or - 1
      B <- or * (m - t) + (n + t)
      C <- -t * n
      x <- (-B + sqrt(B^2 - 4 * A * C))/(2 * A)
    }
    matrix(c(t - x, x, m - t + x, n - x), nrow = 2)
  }
  drawPie <- function(r, from, to, n = 500, col = NA) {
    p <- 2 * pi * seq.int(from, to, length.out = n)/360
    x <- c(cos(p), 0) * r
    y <- c(sin(p), 0) * r
    polygon(x, y, col = col)
    invisible(NULL)
  }
  stdize <- function(tab, std, x) {
    if (std == "margins") {
      if (all(sort(margin) == c(1, 2))) {
        u <- sqrt(odds(tab)$or)
        u <- u/(1 + u)
        y <- matrix(c(u, 1 - u, 1 - u, u), nrow = 2)
      }
      else if (margin %in% c(1, 2)) 
        y <- proportions(tab, margin)
      else stop("incorrect 'margin' specification")
    }
    else if (std == "ind.max") 
      y <- tab/max(tab)
    else if (std == "all.max") 
      y <- tab/max(x)
    y
  }
  odds <- function(x) {
    if (length(dim(x)) == 2) {
      dim(x) <- c(dim(x), 1)
      k <- 1
    }
    else k <- dim(x)[3]
    or <- double(k)
    se <- double(k)
    for (i in 1:k) {
      f <- x[, , i]
      storage.mode(f) <- "double"
      if (any(f == 0)) 
        f <- f + 0.5
      or[i] <- (f[1, 1] * f[2, 2])/(f[1, 2] * f[2, 1])
      se[i] <- sqrt(sum(1/f))
    }
    list(or = or, se = se)
  }
  gamma <- 1.25
  debug <- FALSE
  angle.f <- c(90, 180, 0, 270)
  angle.t <- c(180, 270, 90, 360)
  opar <- par(mar = c(0, 0, if (is.null(main)) 0 else 2.5, 0))
  on.exit(par(opar))
  byrow <- FALSE
  if (!is.null(mfrow)) {
    nr <- mfrow[1]
    nc <- mfrow[2]
  }
  else if (!is.null(mfcol)) {
    nr <- mfcol[1]
    nc <- mfcol[2]
    byrow <- TRUE
  }
  else {
    nr <- ceiling(sqrt(k))
    nc <- ceiling(k/nr)
  }
  if (nr * nc < k) 
    stop("incorrect geometry specification")
  if (byrow) 
    indexMatrix <- expand.grid(1:nc, 1:nr)[, c(2, 1)]
  else indexMatrix <- expand.grid(1:nr, 1:nc)
  totalWidth <- nc * 2 * (1 + space) + (nc - 1) * space
  totalHeight <- if (k == 1) 
    2 * (1 + space)
  else nr * (2 + (2 + gamma) * space) + (nr - 1) * space
  xlim <- c(0, totalWidth)
  ylim <- c(0, totalHeight)
  dev.hold()
  on.exit(dev.flush(), add = TRUE)
  plot.new()
  plot.window(xlim = xlim, ylim = ylim, asp = 1)
  o <- odds(x)
  scale <- space/(2 * strheight("Ag"))
  v <- 0.95 - max(strwidth(as.character(c(x)), cex = scale))/2
  for (i in 1:k) {
    tab <- x[, , i]
    fit <- stdize(tab, std, x)
    xInd <- indexMatrix[i, 2]
    xOrig <- 2 * xInd - 1 + (3 * xInd - 2) * space
    yInd <- indexMatrix[i, 1]
    yOrig <- if (k == 1) 
      (1 + space)
    else (totalHeight - (2 * yInd - 1 + ((3 + gamma) * yInd - 2) * space))
    plot.window(xlim - xOrig, ylim - yOrig, asp = 1)
    if (debug) {
      abline(h = -1 - space)
      abline(h = 1 + space)
      abline(h = 1 + (1 + gamma) * space)
      abline(v = -1 - space)
      abline(v = 1 + space)
    }
    u <- 1 + space/2
    adjCorr <- 0.2
    text(0, u, paste(names(dimnames(x))[1], dimnames(x)[[1]][1], sep = ": "), adj = c(0.5, 0.5 - adjCorr), cex = scale)
    text(-u, 0, paste(names(dimnames(x))[2], dimnames(x)[[2]][1], sep = ": "), adj = c(0.5, 0.5 - adjCorr), cex = scale, srt = 90)
    text(0, -u, paste(names(dimnames(x))[1], dimnames(x)[[1]][2], sep = ": "), adj = c(0.5, 0.5 + adjCorr), cex = scale)
    text(u, 0, paste(names(dimnames(x))[2], dimnames(x)[[2]][2], sep = ": "), adj = c(0.5, 0.5 + adjCorr), cex = scale, srt = 90)
    if (k > 1) {
      text(0, 1 + (1 + gamma/2) * space, paste(names(dimnames(x))[3], dimnames(x)[[3]][i], sep = ": "), cex = gamma * scale)
    }
    d <- odds(tab)$or
    drawPie(sqrt(fit[1, 1]), 90, 180, col = color[1 + (d > 1)])
    drawPie(sqrt(fit[2, 1]), 180, 270, col = color[2 - (d > 1)])
    drawPie(sqrt(fit[1, 2]), 0, 90, col = color[2 - (d > 1)])
    drawPie(sqrt(fit[2, 2]), 270, 360, col = color[1 + (d > 1)])
    u <- 1 - space/2
    text(c(-v, -v, v, v), c(u, -u, u, -u), as.character(c(tab)), cex = scale)
