}, function (x, color = c("#99CCFF", "#6699CC"), conf.level = 0.95, std = c("margins", "ind.max", "all.max"), margin = c(1, 2), space = 0.2, main = NULL, mfrow = NULL, mfcol = NULL) 
{
  if (!is.array(x)) 
    stop("'x' must be an array")
  if (length(dim(x)) == 2) {
    x <- if (is.null(dimnames(x))) 
      array(x, c(dim(x), 1))
    else array(x, c(dim(x), 1), c(dimnames(x), list(NULL)))
  }
  if (length(dim(x)) != 3) 
    stop("'x' must be 2- or 3-dimensional")
  if (any(dim(x)[1:2] != 2)) 
    stop("table for each stratum must be 2 by 2")
  dnx <- dimnames(x)
  if (is.null(dnx)) 
    dnx <- vector("list", 3)
  for (i in which(sapply(dnx, is.null))) dnx[[i]] <- LETTERS[seq_len(dim(x)[i])]
  if (is.null(names(dnx))) 
    i <- 1:3
  else i <- which(is.null(names(dnx)))
  if (any(i)) 
    names(dnx)[i] <- c("Row", "Col", "Strata")[i]
  dimnames(x) <- dnx
  k <- dim(x)[3]
  if (!((length(conf.level) == 1) && is.finite(conf.level) && (conf.level >= 0) && (conf.level < 1))) 
    stop("'conf.level' must be a single number between 0 and 1")
  if (conf.level == 0) 
    conf.level <- FALSE
  std <- match.arg(std)
  findTableWithOAM <- function(or, tab) {
    m <- rowSums(tab)[1]
    n <- rowSums(tab)[2]
    t <- colSums(tab)[1]
    if (or == 1) 
      x <- t * n/(m + n)
    else if (or == Inf) 
      x <- max(0, t - m)
    else {
      A <- or - 1
      B <- or * (m - t) + (n + t)
      C <- -t * n
      x <- (-B + sqrt(B^2 - 4 * A * C))/(2 * A)
    }
    matrix(c(t - x, x, m - t + x, n - x), nrow = 2)
  }
  drawPie <- function(r, from, to, n = 500, col = NA) {
    p <- 2 * pi * seq.int(from, to, length.out = n)/360
    x <- c(cos(p), 0) * r
    y <- c(sin(p), 0) * r
    polygon(x, y, col = col)
    invisible(NULL)
  }
  stdize <- function(tab, std, x) {
    if (std == "margins") {
      if (all(sort(margin) == c(1, 2))) {
        u <- sqrt(odds(tab)$or)
        u <- u/(1 + u)
        y <- matrix(c(u, 1 - u, 1 - u, u), nrow = 2)
      }
      else if (margin %in% c(1, 2)) 
        y <- proportions(tab, margin)
      else stop("incorrect 'margin' specification")
