  odds <- function(x) {
    if (length(dim(x)) == 2) {
      dim(x) <- c(dim(x), 1)
      k <- 1
    }
    else k <- dim(x)[3]
    or <- double(k)
    se <- double(k)
    for (i in 1:k) {
      f <- x[, , i]
      storage.mode(f) <- "double"
      if (any(f == 0)) 
        f <- f + 0.5
      or[i] <- (f[1, 1] * f[2, 2])/(f[1, 2] * f[2, 1])
      se[i] <- sqrt(sum(1/f))
    }
    list(or = or, se = se)
  }
  gamma <- 1.25
  debug <- FALSE
  angle.f <- c(90, 180, 0, 270)
  angle.t <- c(180, 270, 90, 360)
