    fit <- stdize(tab, std, x)
    xInd <- indexMatrix[i, 2]
    xOrig <- 2 * xInd - 1 + (3 * xInd - 2) * space
    yInd <- indexMatrix[i, 1]
    yOrig <- if (k == 1) 
      (1 + space)
    else (totalHeight - (2 * yInd - 1 + ((3 + gamma) * yInd - 2) * space))
    plot.window(xlim - xOrig, ylim - yOrig, asp = 1)
    if (debug) {
      abline(h = -1 - space)
      abline(h = 1 + space)
      abline(h = 1 + (1 + gamma) * space)
      abline(v = -1 - space)
      abline(v = 1 + space)
    }
    u <- 1 + space/2
    adjCorr <- 0.2
    text(0, u, paste(names(dimnames(x))[1], dimnames(x)[[1]][1], sep = ": "), adj = c(0.5, 0.5 - adjCorr), cex = scale)
    text(-u, 0, paste(names(dimnames(x))[2], dimnames(x)[[2]][1], sep = ": "), adj = c(0.5, 0.5 - adjCorr), cex = scale, srt = 90)
    text(0, -u, paste(names(dimnames(x))[1], dimnames(x)[[1]][2], sep = ": "), adj = c(0.5, 0.5 + adjCorr), cex = scale)
    text(u, 0, paste(names(dimnames(x))[2], dimnames(x)[[2]][2], sep = ": "), adj = c(0.5, 0.5 + adjCorr), cex = scale, srt = 90)
    if (k > 1) {
      text(0, 1 + (1 + gamma/2) * space, paste(names(dimnames(x))[3], dimnames(x)[[3]][i], sep = ": "), cex = gamma * scale)
    }
