    drawPie(sqrt(fit[1, 1]), 90, 180, col = color[1 + (d > 1)])
    drawPie(sqrt(fit[2, 1]), 180, 270, col = color[2 - (d > 1)])
    drawPie(sqrt(fit[1, 2]), 0, 90, col = color[2 - (d > 1)])
    drawPie(sqrt(fit[2, 2]), 270, 360, col = color[1 + (d > 1)])
    u <- 1 - space/2
    text(c(-v, -v, v, v), c(u, -u, u, -u), as.character(c(tab)), cex = scale)
    if (is.numeric(conf.level)) {
      or <- o$or[i]
      se <- o$se[i]
      theta <- or * exp(stats::qnorm((1 - conf.level)/2) * se)
      tau <- findTableWithOAM(theta, tab)
      r <- sqrt(c(stdize(tau, std, x)))
      for (j in 1:4) drawPie(r[j], angle.f[j], angle.t[j])
      theta <- or * exp(stats::qnorm((1 + conf.level)/2) * se)
      tau <- findTableWithOAM(theta, tab)
      r <- sqrt(c(stdize(tau, std, x)))
      for (j in 1:4) drawPie(r[j], angle.f[j], angle.t[j])
    }
    polygon(c(-1, 1, 1, -1), c(-1, -1, 1, 1))
    lines(c(-1, 1), c(0, 0))
    for (j in seq.int(from = -0.8, to = 0.8, by = 0.2)) lines(c(j, j), c(-0.02, 0.02))
    for (j in seq.int(from = -0.9, to = 0.9, by = 0.2)) lines(c(j, j), c(-0.01, 0.01))
    lines(c(0, 0), c(-1, 1))
    for (j in seq.int(from = -0.8, to = 0.8, by = 0.2)) lines(c(-0.02, 0.02), c(j, j))
    for (j in seq.int(from = -0.9, to = 0.9, by = 0.2)) lines(c(-0.01, 0.01), c(j, j))
  }
  if (!is.null(main)) 
    mtext(main, cex = 1.5, adj = 0.5)
  return(invisible())
})
