list(`package:graphics` = function (x, y = 0, to = 1, from = y, xlim = NULL, ylab = NULL, ...) 
{
  if (!missing(y) && missing(from)) 
    from <- y
  if (is.null(xlim)) {
    if (is.null(from)) 
      from <- 0
  }
  else {
    if (missing(from)) 
      from <- xlim[1]
    if (missing(to)) 
      to <- xlim[2]
  }
  if (is.null(ylab)) {
    sx <- substitute(x)
    ylab <- if (mode(x) != "name") 
      deparse(sx)[1]
    else {
      xname <- list(...)[["xname"]]
      if (is.null(xname)) 
        xname <- "x"
      paste0(sx, "(", xname, ")")
    }
  }
  curve(expr = x, from = from, to = to, xlim = xlim, ylab = ylab, ...)
