list(`package:graphics` = function (xy, type, pch = par("pch"), lty = par("lty"), col = par("col"), bg = NA, cex = 1, lwd = par("lwd"), ...) 
{
  if (is.null(type)) 
    type <- "p"
  type <- as.character(type)
  if (length(type) != 1 || !nzchar(type) || is.na(type)) 
    stop(gettextf("invalid plot type"))
  if (nchar(type) > 1) 
    warning(gettextf("plot type '%s' will be truncated to first character", type))
  t <- substr(type, 1, 1)
  if (!isTRUE(t %in% c("l", "o", "b", "c", "s", "S", "h", "p", "n"))) 
    stop(gettextf("invalid plot type '%s'", t))
  invisible(.External.graphics(C_plotXY, xy, t, pch, lty, col, bg, cex, lwd, ...))
}, function (xy, type, pch = par("pch"), lty = par("lty"), col = par("col"), bg = NA, cex = 1, lwd = par("lwd"), ...) 
{
  if (is.null(type)) 
