list(`package:graphics` = function (x, y = NULL, density = NULL, angle = 45, border = NULL, col = NA, lty = par("lty"), ..., fillOddEven = FALSE) 
{
  ..debug.hatch <- FALSE
  xy <- xy.coords(x, y, setLab = FALSE)
  if (is.numeric(density) && all(is.na(density) | density < 0)) 
    density <- NULL
  if (!is.null(angle) && !is.null(density)) {
    polygon.onehatch <- function(x, y, x0, y0, xd, yd, ..debug.hatch = FALSE, ...) {
      if (..debug.hatch) {
        points(x0, y0)
        arrows(x0, y0, x0 + xd, y0 + yd)
      }
      halfplane <- as.integer(xd * (y - y0) - yd * (x - x0) <= 0)
      cross <- halfplane[-1] - halfplane[-length(halfplane)]
      does.cross <- cross != 0
      if (!any(does.cross)) 
        return()
      x1 <- x[-length(x)][does.cross]
      y1 <- y[-length(y)][does.cross]
      x2 <- x[-1][does.cross]
      y2 <- y[-1][does.cross]
      t <- (((x1 - x0) * (y2 - y1) - (y1 - y0) * (x2 - x1))/(xd * (y2 - y1) - yd * (x2 - x1)))
      o <- order(t)
      tsort <- t[o]
      crossings <- cumsum(cross[does.cross][o])
      if (fillOddEven) 
        crossings <- crossings%%2
      drawline <- crossings != 0
      lx <- x0 + xd * tsort
      ly <- y0 + yd * tsort
      lx1 <- lx[-length(lx)][drawline]
      ly1 <- ly[-length(ly)][drawline]
      lx2 <- lx[-1][drawline]
      ly2 <- ly[-1][drawline]
      segments(lx1, ly1, lx2, ly2, ...)
    }
    polygon.fullhatch <- function(x, y, density, angle, ..debug.hatch = FALSE, ...) {
      x <- c(x, x[1])
      y <- c(y, y[1])
      angle <- angle%%180
      if (par("xlog") || par("ylog")) {
        warning("cannot hatch with logarithmic scale active")
        return()
      }
      usr <- par("usr")
      pin <- par("pin")
      upi <- c(usr[2] - usr[1], usr[4] - usr[3])/pin
      if (upi[1] < 0) 
        angle <- 180 - angle
      if (upi[2] < 0) 
        angle <- 180 - angle
      upi <- abs(upi)
      xd <- cos(angle/180 * pi) * upi[1]
      yd <- sin(angle/180 * pi) * upi[2]
      if (angle < 45 || angle > 135) {
        if (angle < 45) {
          first.x <- max(x)
          last.x <- min(x)
        }
        else {
          first.x <- min(x)
          last.x <- max(x)
        }
        y.shift <- upi[2]/density/abs(cos(angle/180 * pi))
        x0 <- 0
        y0 <- floor((min(y) - first.x * yd/xd)/y.shift) * y.shift
        y.end <- max(y) - last.x * yd/xd
        while (y0 < y.end) {
          polygon.onehatch(x, y, x0, y0, xd, yd, ..debug.hatch = ..debug.hatch, ...)
          y0 <- y0 + y.shift
        }
      }
      else {
        if (angle < 90) {
          first.y <- max(y)
          last.y <- min(y)
        }
        else {
          first.y <- min(y)
          last.y <- max(y)
        }
        x.shift <- upi[1]/density/abs(sin(angle/180 * pi))
        x0 <- floor((min(x) - first.y * xd/yd)/x.shift) * x.shift
        y0 <- 0
        x.end <- max(x) - last.y * xd/yd
        while (x0 < x.end) {
          polygon.onehatch(x, y, x0, y0, xd, yd, ..debug.hatch = ..debug.hatch, ...)
          x0 <- x0 + x.shift
        }
      }
    }
    if (missing(col) || is.null(col)) {
      col <- par("fg")
    }
    else if (any(is.na(col))) {
      col[is.na(col)] <- par("fg")
    }
    if (is.null(border)) 
      border <- col
    if (is.logical(border)) {
      if (!is.na(border) && border) 
        border <- col
      else border <- NA
    }
    start <- 1
    ends <- c(seq_along(xy$x)[is.na(xy$x) | is.na(xy$y)], length(xy$x) + 1)
    num.polygons <- length(ends)
    col <- rep_len(col, num.polygons)
    if (length(border)) 
      border <- rep_len(border, num.polygons)
    if (length(lty)) 
      lty <- rep_len(lty, num.polygons)
    if (length(density)) 
      density <- rep_len(density, num.polygons)
    angle <- rep_len(angle, num.polygons)
    i <- 1
    for (end in ends) {
      if (end > start) {
