list(`package:graphics` = function (x, y = NULL, border = NULL, col = NA, lty = par("lty"), rule = "winding", ...) 
{
  xy <- xy.coords(x, y, setLab = FALSE)
  if (is.logical(border)) {
    if (!is.na(border) && border) 
      border <- par("fg")
    else border <- NA
  }
  rule <- match(rule, c("winding", "evenodd"))
  if (is.na(rule)) 
    stop("Invalid fill rule for graphics path")
  breaks <- which(is.na(xy$x) | is.na(xy$y))
  if (length(breaks) == 0) {
    .External.graphics(C_path, xy$x, xy$y, as.integer(length(xy$x)), as.integer(rule), col, border, lty, ...)
  }
  else {
    nb <- length(breaks)
    lengths <- c(breaks[1] - 1, diff(breaks) - 1, length(xy$x) - breaks[nb])
    .External.graphics(C_path, xy$x[-breaks], xy$y[-breaks], as.integer(lengths), as.integer(rule), col, border, lty, ...)
  }
  invisible()
