      2.3
    else 2.1
    locations <- expand.grid(ff * 1:ncol, ff * nrow:1)[1:n.loc, ]
    if (!is.null(labels) && (missing(flip.labels) || !is.logical(flip.labels))) 
      flip.labels <- ncol * mean(nchar(labels, type = "c")) > 30
  }
  else {
    if (is.numeric(locations) && length(locations) == 2) {
      locations <- cbind(rep.int(locations[1], n.loc), rep.int(locations[2], n.loc))
      if (!missing(labels) && n.loc > 1) 
        warning("labels do not make sense for a single location")
      else labels <- NULL
    }
    else {
      if (is.data.frame(locations)) 
        locations <- data.matrix(locations)
      if (!is.matrix(locations) || ncol(locations) != 2) 
        stop("'locations' must be a 2-column matrix.")
      if (n.loc != nrow(locations)) 
        stop("number of rows of 'locations' and 'x' must be equal.")
    }
    if (missing(flip.labels) || !is.logical(flip.labels)) 
      flip.labels <- FALSE
  }
  xloc <- locations[, 1]
  yloc <- locations[, 2]
  angles <- if (full) 
    seq.int(0, 2 * pi, length.out = n.seg + 1)[-(n.seg + 1)]
  else if (draw.segments) 
    seq.int(0, pi, length.out = n.seg + 1)[-(n.seg + 1)]
  else seq.int(0, pi, length.out = n.seg)
  if (length(angles) != n.seg) 
    stop("length of 'angles' must equal 'ncol(x)'")
  if (scale) {
    x <- apply(x, 2, function(x) (x - min(x, na.rm = TRUE))/diff(range(x, na.rm = TRUE)))
  }
  x[is.na(x)] <- 0
  mx <- max(x <- x * len)
  if (is.null(xlim)) 
    xlim <- range(xloc) + c(-mx, mx)
  if (is.null(ylim)) 
    ylim <- range(yloc) + c(-mx, mx)
  deg <- pi/180
  op <- par(mar = mar, xpd = xpd)
  on.exit(par(op))
  dev.hold()
  on.exit(dev.flush(), add = TRUE)
  if (plot && !add) 
    plot(0, type = "n", ..., xlim = xlim, ylim = ylim, main = main, sub = sub, xlab = xlab, ylab = ylab, asp = 1, axes = axes)
  if (!plot) 
    return(locations)
  s.x <- xloc + x * rep.int(cos(angles), rep.int(n.loc, n.seg))
  s.y <- yloc + x * rep.int(sin(angles), rep.int(n.loc, n.seg))
  if (draw.segments) {
    aangl <- c(angles, if (full) 2 * pi else pi)
    for (i in 1:n.loc) {
      px <- py <- numeric()
      for (j in 1:n.seg) {
        k <- seq.int(from = aangl[j], to = aangl[j + 1], by = 1 * deg)
        px <- c(px, xloc[i], s.x[i, j], x[i, j] * cos(k) + xloc[i], NA)
        py <- c(py, yloc[i], s.y[i, j], x[i, j] * sin(k) + yloc[i], NA)
      }
      polygon(px, py, col = col.segments, lwd = lwd, lty = lty)
    }
  }
  else {
    for (i in 1:n.loc) {
      polygon(s.x[i, ], s.y[i, ], lwd = lwd, lty = lty, col = col.stars[i])
      polygon(s.x[i, ], s.y[i, ], lwd = lwd, lty = lty, border = col.lines[i], col = col.stars[i])
      if (radius) 
        segments(rep.int(xloc[i], n.seg), rep.int(yloc[i], n.seg), s.x[i, ], s.y[i, ], lwd = lwd, lty = lty)
    }
  }
  if (!is.null(labels)) {
    y.off <- mx * (if (full) 
      1
      else 0.1)
    if (flip.labels) 
      y.off <- y.off + cex * par("cxy")[2] * ((1:n.loc)%%2 - if (full) 
        0.4
        else 0)
    text(xloc, yloc - y.off, labels, cex = cex, adj = c(0.5, 1))
  }
  if (!is.null(key.loc)) {
    par(xpd = key.xpd)
    key.x <- len * cos(angles) + key.loc[1]
    key.y <- len * sin(angles) + key.loc[2]
    if (draw.segments) {
      px <- py <- numeric()
      for (j in 1:n.seg) {
        k <- seq.int(from = aangl[j], to = aangl[j + 1], by = 1 * deg)
        px <- c(px, key.loc[1], key.x[j], len * cos(k) + key.loc[1], NA)
        py <- c(py, key.loc[2], key.y[j], len * sin(k) + key.loc[2], NA)
      }
      polygon(px, py, col = col.segments, lwd = lwd, lty = lty)
    }
    else {
      polygon(key.x, key.y, lwd = lwd, lty = lty)
      if (radius) 
        segments(rep.int(key.loc[1], n.seg), rep.int(key.loc[2], n.seg), key.x, key.y, lwd = lwd, lty = lty)
    }
    lab.angl <- angles + if (draw.segments) 
      (angles[2] - angles[1])/2
    else 0
    label.x <- 1.1 * len * cos(lab.angl) + key.loc[1]
    label.y <- 1.1 * len * sin(lab.angl) + key.loc[2]
    for (k in 1:n.seg) {
      text.adj <- c(if (lab.angl[k] < 90 * deg || lab.angl[k] > 270 * deg) 0 else if (lab.angl[k] > 90 * deg && lab.angl[k] < 270 * deg) 1 else 0.5, if (lab.angl[k] <= 90 * deg) (1 - lab.angl[k]/(90 * deg))/2 else if (lab.angl[k] <= 270 * deg) (lab.angl[k] - 90 * deg)/(180 * deg) else 1 - (lab.angl[k] - 270 * deg)/(180 * deg))
      text(label.x[k], label.y[k], labels = key.labels[k], cex = cex, adj = text.adj)
    }
  }
  if (frame.plot) 
    box(...)
  invisible(locations)
})
