        else "", domain = NA, call. = FALSE)
      }
      names(new) <- NULL
      if (any(doubt)) {
        ii <- !doubt | override.check
        old[i.match[ii]] <- new[ii]
      }
      else old[i.match] <- new
    }
    if (assign.opt) 
