      prev <- old[i.match]
      doubt <- rep.int(FALSE, length(prev))
      for (fn in check.attributes) if (any(ii <- sapply(prev, fn) != sapply(new, fn))) {
        ii <- ii & (names(prev) != "fonts")
        if (!any(ii)) 
          next
        doubt <- doubt | ii
        do.keep <- ii & !override.check
        warning(paste(sQuote(paste0(fn, "(", names(prev[ii]), ")")), collapse = " and "), " ", ngettext(as.integer(sum(ii)), "differs between new and previous", "differ between new and previous"), if (any(do.keep)) {
