list(`package:grDevices` = function (x, y = NULL) 
{
  X <- xy.coords(x, y, recycle = TRUE, setLab = FALSE)
  x <- cbind(X$x, X$y)
  if (any(!is.finite(x))) 
    stop("finite coordinates are needed")
  if (nrow(x) == 0) 
    return(integer())
  if (nrow(x) == 1) 
    return(1)
  res <- .Call(C_chull, x)
  if (length(res) < 2) 
    return(res)
  xx <- sweep(x[res, ], 2, colMeans(x[res, ]))
  angs <- atan2(xx[, 2], -xx[, 1])
  res[order(angs)]
