    stop("'bias' must be positive")
  if (!missing(space) && alpha) 
    stop("'alpha' must be false if 'space' is specified")
  colors <- t(col2rgb(colors, alpha = alpha)/255)
  space <- match.arg(space)
  interpolate <- match.arg(interpolate)
  if (space == "Lab") 
    colors <- convertColor(colors, from = "sRGB", to = "Lab")
  interpolate <- switch(interpolate, linear = stats::approxfun, spline = stats::splinefun)
  if ((nc <- nrow(colors)) == 1) {
    colors <- colors[c(1, 1), ]
    nc <- 2
  }
  x <- seq.int(0, 1, length.out = nc)^bias
  palette <- c(interpolate(x, colors[, 1]), interpolate(x, colors[, 2]), interpolate(x, colors[, 3]), if (alpha) interpolate(x, colors[, 4]))
  roundcolor <- function(rgb) pmax(pmin(rgb, 1), 0)
  if (space == "Lab") 
    function(x) roundcolor(convertColor(cbind(palette[[1]](x), palette[[2]](x), palette[[3]](x), if (alpha) 
      palette[[4]](x)), from = "Lab", to = "sRGB")) * 255
  else function(x) roundcolor(cbind(palette[[1]](x), palette[[2]](x), palette[[3]](x), if (alpha) 
