list(`package:grDevices` = function (file, type = "png16m", height = 7, width = 7, res = 72, units = "in", pointsize, ..., method = c("postscript", "pdf"), taa = NA, gaa = NA) 
{
  if (missing(file)) 
    stop("'file' is missing with no default")
  if (!is.character(file) || length(file) != 1 || !nzchar(file)) 
    stop("'file' must be a non-empty character string")
  method <- match.arg(method)
  units <- match.arg(units, c("in", "px", "cm", "mm"))
  height <- switch(units, `in` = 1, cm = 1/2.54, mm = 1/25.4, px = 1/res) * height
  width <- switch(units, `in` = 1, cm = 1/2.54, mm = 1/25.4, px = 1/res) * width
  gsexe <- tools::find_gs_cmd()
  if (!nzchar(gsexe)) 
    stop("GhostScript was not found")
  check_gs_type(gsexe, type)
  if (missing(pointsize)) 
    pointsize <- 1.5 * min(width, height)
  tmp <- tempfile("Rbit")
  on.exit(unlink(tmp))
  din <- graphics::par("din")
  w <- din[1]
  h <- din[2]
  if (missing(width) && !missing(height)) 
    width <- w/h * height
  if (missing(height) && !missing(width)) 
    height <- h/w * width
  current.device <- dev.cur()
  if (method == "pdf") 
    dev.off(dev.copy(device = pdf, file = tmp, width = width, height = height, pointsize = pointsize, paper = "special", ...))
  else dev.off(dev.copy(device = postscript, file = tmp, width = width, height = height, pointsize = pointsize, paper = "special", horizontal = FALSE, ...))
