  cmd <- paste0(gsexe, " -dNOPAUSE -dBATCH -q -sDEVICE=", type, " -r", res, " -dAutoRotatePages=/None", " -g", ceiling(res * width), "x", ceiling(res * height), extra, " -sOutputFile=", shQuote(file), " ", tmp)
  system(cmd, invisible = TRUE)
