list(`package:grDevices` = function (n, palette = "viridis", alpha = NULL, rev = FALSE, fixup = TRUE) 
{
  n <- as.integer(n[1])
  if (n < 1) 
    return(character())
  fx <- function(x) tolower(gsub("[-, _, \\,, (, ), \\ , \\.]", "", x))
  p <- charmatch(fx(palette), fx(rownames(.hcl_colors_parameters)))
  if (is.na(p)) 
    stop("'palette' does not match any given palette")
  if (p < 1) 
    stop("'palette' is ambiguous")
  p <- .hcl_colors_parameters[p, ]
  p.type <- as.character(p$type[1])
  p <- unlist(p[1, -1, drop = TRUE])
  lintrj <- function(i, p1, p2) p2 - (p2 - p1) * i
  tritrj <- function(i, j, p1, p2, pm) ifelse(i <= j, p2 - (p2 - pm) * i/j, pm - (pm - p1) * abs((i - j)/(1 - j)))
  seqhcl <- function(i, h1, h2, c1, c2, l1, l2, p1, p2, cmax) {
    j <- 1/(1 + abs(cmax - c1)/abs(cmax - c2))
    if (!is.na(j) && (j <= 0 || 1 <= j)) 
      j <- NA
    hcl(h = lintrj(i, h1, h2), c = if (is.na(j)) 
      lintrj(i^p1, c1, c2)
      else tritrj(i^p1, j, c1, c2, cmax), l = lintrj(i^p2, l1, l2), alpha = alpha, fixup = fixup)
  }
  switch(p.type, qualitative = {
    if (is.na(p[["h2"]])) p[["h2"]] <- p[["h1"]] + 360 * (n - 1)/n
    i <- seq.int(1, 0, length.out = n)
    col <- hcl(h = lintrj(i, p[["h1"]], p[["h2"]]), c = p[["c1"]], l = p[["l1"]], alpha = alpha, fixup = fixup)
  }, sequential = {
    if (is.na(p[["h2"]])) p[["h2"]] <- p[["h1"]]
    if (is.na(p[["c2"]])) p[["c2"]] <- 0
    if (is.na(p[["p2"]])) p[["p2"]] <- p[["p1"]]
    i <- seq.int(1, 0, length.out = n)
    col <- seqhcl(i, p[["h1"]], p[["h2"]], p[["c1"]], p[["c2"]], p[["l1"]], p[["l2"]], p[["p1"]], p[["p2"]], p[["cmax1"]])
  }, diverging = {
    if (is.na(p[["p2"]])) p[["p2"]] <- p[["p1"]]
    n2 <- ceiling(n/2)
    i <- seq.int(1, by = -2/(n - 1), length.out = n2)
    col <- c(seqhcl(i, p[["h1"]], p[["h1"]], p[["c1"]], 0, p[["l1"]], p[["l2"]], p[["p1"]], p[["p2"]], p[["cmax1"]]), rev(seqhcl(i, p[["h2"]], p[["h2"]], p[["c1"]], 0, p[["l1"]], p[["l2"]], p[["p1"]], p[["p2"]], p[["cmax1"]])))
    if (n%/%2 < n2) col <- col[-n2]
  }, divergingx = {
    if (is.na(p[["p2"]])) p[["p2"]] <- p[["p1"]]
    if (is.na(p[["p4"]])) p[["p4"]] <- p[["p2"]]
    n2 <- ceiling(n/2)
    i <- seq.int(1, by = -2/(n - 1), length.out = n2)
    col <- c(seqhcl(i, p[["h1"]], if (is.na(p[["h2"]])) p[["h1"]] else p[["h2"]], p[["c1"]], p[["c2"]], p[["l1"]], p[["l2"]], p[["p1"]], p[["p2"]], p[["cmax1"]]), rev(seqhcl(i, p[["h3"]], if (is.na(p[["h2"]])) p[["h3"]] else p[["h2"]], p[["c3"]], p[["c2"]], p[["l3"]], p[["l2"]], p[["p3"]], p[["p4"]], p[["cmax2"]])))
    if (n%/%2 < n2) col <- col[-n2]
  }, stop("wrong 'type'; should never happen, please report!"))
  if (rev) 
    rev(col)
  else col
}, function (n, palette = "viridis", alpha = NULL, rev = FALSE, fixup = TRUE) 
{
