list(`package:grDevices` = function (red, green, blue, name = NULL, white = "D65", gamma = 2.2) 
{
  whitexyz <- c2to3(white.points[, white])
  rgb <- rbind(c2to3(red), c2to3(green), c2to3(blue))
  S <- drop(whitexyz %*% solve(rgb))
  M <- S * rgb
  if (is.numeric(gamma) && length(gamma) == 1) {
    dogamma <- function(x) x %^% gamma
    ungamma <- function(x) x %^% (1/gamma)
  }
  else if (gamma == "sRGB") {
    dogamma <- function(x) .ifelse(x < 0.04045, x/12.92, ((x + 0.055)/1.055)^2.4)
    ungamma <- function(x) .ifelse(x <= 0.0031308, 12.92 * x, 1.055 * x %^% (1/2.4) - 0.055)
  }
  else stop("'gamma' must be a scalar or 'sRGB'")
  toXYZ <- function(rgb, ...) {
    dogamma(rgb) %*% M
  }
  toRGB <- function(xyz, ...) {
    res <- ungamma(xyz %*% solve(M))
    if (nrow(res) == 1) 
      res[1, , drop = TRUE]
    else res
  }
  if (is.null(name)) 
    name <- deparse(sys.call())[1]
  RGBcolorConverter(toXYZ = toXYZ, fromXYZ = toRGB, gamma = gamma, white = white, name = name, vectorized = TRUE)
