{
  if (!is.null(n)) {
    n <- as.integer(n[1])
    if (n < 1) 
      return(character())
  }
  p <- palette.match(palette)
  if (is.na(p)) 
    stop("'palette' does not match any given palette")
  if (p < 1) 
    stop("'palette' is ambiguous")
  nc <- length(cols <- .palette_colors_hex[[p]])
  if (is.null(n)) 
    n <- nc
  else if (n > nc) {
    if (recycle) {
      cols <- cols[rep_len(seq_len(nc), n)]
    }
    else {
      warning(sprintf("'n' set to %s, the maximum available for %s palette", nc, palette))
