list(`package:grDevices` = function (x, y = NULL, xlab = NULL, ylab = NULL, log = NULL, recycle = FALSE, setLab = TRUE) 
{
  if (is.null(y)) {
    if (is.null(ylab)) 
      ylab <- xlab
    if (is.language(x)) {
      if (inherits(x, "formula") && length(x) == 3) {
        if (setLab) {
          ylab <- deparse(x[[2]])
          xlab <- deparse(x[[3]])
        }
        y <- eval(x[[2]], environment(x))
        x <- eval(x[[3]], environment(x))
      }
      else stop("invalid first argument")
    }
    else if (inherits(x, "ts")) {
      y <- if (is.matrix(x)) 
        x[, 1]
      else x
      x <- stats::time(x)
      if (setLab) 
        xlab <- "Time"
    }
    else if (is.complex(x)) {
      y <- Im(x)
      x <- Re(x)
      if (setLab) {
        xlab <- paste0("Re(", ylab, ")")
        ylab <- paste0("Im(", ylab, ")")
      }
    }
    else if (is.matrix(x) || is.data.frame(x)) {
      x <- data.matrix(x)
      if (ncol(x) == 1) {
        if (setLab) 
          xlab <- "Index"
        y <- x[, 1]
        x <- seq_along(y)
      }
      else {
        colnames <- dimnames(x)[[2]]
        if (setLab) {
          if (is.null(colnames)) {
            xlab <- paste0(ylab, "[,1]")
            ylab <- paste0(ylab, "[,2]")
          }
          else {
            xlab <- colnames[1]
            ylab <- colnames[2]
          }
        }
        y <- x[, 2]
        x <- x[, 1]
      }
    }
    else if (is.list(x)) {
      if (all(c("x", "y") %in% names(x))) {
        if (setLab) {
          xlab <- paste0(ylab, "$x")
          ylab <- paste0(ylab, "$y")
        }
        y <- x[["y"]]
        x <- x[["x"]]
      }
      else stop("'x' is a list, but does not have components 'x' and 'y'")
    }
    else {
      if (is.factor(x)) 
        x <- as.numeric(x)
      if (setLab) 
        xlab <- "Index"
      y <- x
      x <- seq_along(x)
    }
  }
  if (inherits(x, "POSIXt")) 
    x <- as.POSIXct(x)
  if (length(x) != length(y)) {
    if (recycle) {
      if ((nx <- length(x)) < (ny <- length(y))) 
        x <- rep_len(x, ny)
      else y <- rep_len(y, nx)
    }
    else stop("'x' and 'y' lengths differ")
  }
  if (length(log) && log != "") {
    log <- strsplit(log, NULL)[[1]]
    if ("x" %in% log && any(ii <- x <= 0 & !is.na(x))) {
      n <- as.integer(sum(ii))
      warning(sprintf(ngettext(n, "%d x value <= 0 omitted from logarithmic plot", "%d x values <= 0 omitted from logarithmic plot"), n), domain = NA)
      x[ii] <- NA
    }
    if ("y" %in% log && any(ii <- y <= 0 & !is.na(y))) {
      n <- as.integer(sum(ii))
      warning(sprintf(ngettext(n, "%d y value <= 0 omitted from logarithmic plot", "%d y values <= 0 omitted from logarithmic plot"), n), domain = NA)
      y[ii] <- NA
    }
  }
  list(x = as.double(x), y = as.double(y), xlab = xlab, ylab = ylab)
}, function (x, y = NULL, xlab = NULL, ylab = NULL, log = NULL, recycle = FALSE, setLab = TRUE) 
{
