list(`package:grDevices` = function (x, y = NULL, digits) 
{
  x <- xy.coords(x, y, setLab = FALSE)
  y <- signif(x$y, digits = digits)
  x <- signif(x$x, digits = digits)
  n <- length(x)
  number <- if (n > 0) {
    orderxy <- order(x, y)
    x <- x[orderxy]
    y <- y[orderxy]
    first <- c(TRUE, (x[-1] != x[-n]) | (y[-1] != y[-n]))
    x <- x[first]
    y <- y[first]
    diff(c((1:n)[first], n + 1))
  }
  else integer()
  list(x = x, y = y, number = number)
}, function (x, y = NULL, digits) 
{
  x <- xy.coords(x, y, setLab = FALSE)
  y <- signif(x$y, digits = digits)
  x <- signif(x$x, digits = digits)
  n <- length(x)
  number <- if (n > 0) {
    orderxy <- order(x, y)
    x <- x[orderxy]
    y <- y[orderxy]
    first <- c(TRUE, (x[-1] != x[-n]) | (y[-1] != y[-n]))
    x <- x[first]
    y <- y[first]
    diff(c((1:n)[first], n + 1))
  }
  else integer()
  list(x = x, y = y, number = number)
})
