list(`package:htmltools` = function (dependencies, srcType = c("href", "file"), encodeFunc = urlEncodePath, hrefFilter = identity) 
{
  html <- c()
  for (dep in dependencies) {
    usableType <- srcType[which(srcType %in% names(dep$src))]
    if (length(usableType) == 0) 
      stop("Dependency ", dep$name, " ", dep$version, " does not have a usable source")
    dir <- dep$src[head(usableType, 1)]
    srcpath <- if (usableType == "file") {
      encodeFunc(dir)
    }
    else {
      href_path(dep)
    }
    srcpath <- sub("/$", "\\1", srcpath)
    if (length(dep$meta) > 0) {
      html <- c(html, paste("<meta name=\"", htmlEscape(names(dep$meta)), "\" content=\"", htmlEscape(dep$meta), "\" />", sep = ""))
    }
    if (length(dep$stylesheet) > 0) {
      html <- c(html, paste("<link href=\"", htmlEscape(hrefFilter(file.path(srcpath, encodeFunc(dep$stylesheet)))), "\" rel=\"stylesheet\" />", sep = ""))
    }
    if (length(dep$script) > 0) {
      html <- c(html, renderScript(dep$script, srcpath, encodeFunc, hrefFilter))
    }
    if (length(dep$attachment) > 0) {
      if (is.null(names(dep$attachment))) 
        names(dep$attachment) <- as.character(1:length(dep$attachment))
      html <- c(html, sprintf("<link id=\"%s-%s-attachment\" rel=\"attachment\" href=\"%s\"/>", htmlEscape(dep$name), htmlEscape(names(dep$attachment)), htmlEscape(hrefFilter(file.path(srcpath, encodeFunc(dep$attachment))))))
    }
    html <- c(html, dep$head)
  }
  HTML(paste(html, collapse = "\n"))
